import './App.css';
import axios from 'axios';
import YouTube from 'react-youtube';

class App extends Component {
    constructor (props) {
        super(props);
        this.state = {
            videoId: null,
            results: null
        }
    }

    searchHandler() {
        axios
            .get(
                'https://www.googleapis.com/youtube/v3/search?part=snippet&key=AIzaSyDeMhcfA8lM8PGnMAkPl2n76hog-lAzgxc&type=video&q=ajax'
            )
            .then((response) => {
                console.log(response);
                this.setState({
