                })
            })
            .catch((err) => console.log(err));
    }

    render () {
        return (
            <div>
                <header>
                    <p>YouTube Demo</p>
                    <input></input>
                    <button onClick={() => this.searchHandler()}>Search</button>
                </header>
                <div className="App">
                    <YouTube />
                    <div>
                        {this.state.results ? <p>Results go here</p> : null}
                    </div>
                </div>
            </div>
        );
    }
}

export default App;
